  false,\n\t\"url\": null,\n\t\"notes\": \"This part of DS 781 presents data for the
  acoustic-backscatter map of Monterey Canyon and Vicinity map area, California. Backscatter
  data are provided as separate grids depending on mapping system and processing method.
  These metadata describe acoustic-backscatter data collected and processed by the
  U.S. Geological Survey. The raster data files are included in \"BackscatterD_CSUMB_SWATH_MontereyCanyon.zip,\"
  which is accessible from http://dx.doi.org/10.5066/F7XD0ZQ4. The acoustic-backscatter
  map of Monterey Canyon and Vicinity, California, were generated from acoustic-backscatter
  data collected by the U.S. Geological Survey (USGS), by Monterey Bay Aquarium Research
  Institute (MBARI), and by California State University, Monterey Bay (CSUMB). Mapping
  for the entire map area was completed between 1998 and 2014 using a combination
  of 30-kHz Simrad EM-300 and 200-kHz/400-kHz Reson 7125 multibeam echosounders, as
  well as 234-kHz and 468-kHz SEA SWATHplus bathymetric sidescan-sonar systems. The
  CSUMB mapping missions were completed in 2008 and 2009. Within the final imagery,
  brighter tones indicate higher backscatter intensity, and darker tones indicate
  lower backscatter intensity. The intensity represents a complex interaction between
  the acoustic pulse and the seafloor, as well as characteristics within the shallow
  subsurface, providing a general indication of seafloor texture and composition.
  Backscatter intensity depends on the acoustic source level; the frequency used to
  image the seafloor; the grazing angle; the composition and character of the seafloor,
  including grain size, water content, bulk density, and seafloor roughness; and some
  biological cover. Harder and rougher bottom types such as rocky outcrops or coarse
  sediment typically return stronger intensities (high backscatter, lighter tones),
  whereas softer bottom types such as fine sediment return weaker intensities (low
  backscatter, darker tones).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
